// Dashboard.js

import React from 'react';
import NavBarCommon from '../../components/NavBarCommon';
import Stack from 'react-bootstrap/Stack';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import './Dashboard.css';

export default function Dashboard() {
  return (
    <div>
      <NavBarCommon />

      <Stack className="card-container" gap={2}>
        {/* First Row */}
        <Card style={{ width: '80%' }}>
          {/* Your content for the first card */}
        </Card>

        {/* Second Row */}
        <Row className="second-row">
          <Col md={4}>
            <Card style={{ width: '100%' }}>
              {/* Your content for the second card */}
            </Card>
          </Col>
          <Col md={4}>
            <Card style={{ width: '100%' }}>
              {/* Your content for the third card */}
            </Card>
          </Col>
          <Col md={4}>
            <Card style={{ width: '100%' }}>
              {/* Your content for the fourth card */}
            </Card>
          </Col>
        </Row>

        {/* Third Row */}
        <Card style={{ width: '100%' }}>
          {/* Your content for the fifth card */}
        </Card>

        {/* Fourth Row */}
        <Stack direction="horizontal">
          <Col md={8}>
            <Card className="merged-card">
              {/* Your content for the merged card */}
            </Card>
          </Col>
        </Stack>
      </Stack>
    </div>
  );
}
